CREATE TABLE actor (
  actor_id NUMERIC(5) NOT NULL,
  first_name varchar(45) NOT NULL,
  last_name varchar(45) NOT NULL,
  last_update timestamp NOT NULL,
  PRIMARY KEY (actor_id)
)


CREATE TABLE category (
  category_id NUMERIC(3) NOT NULL,
  name varchar(25) NOT NULL,
  last_update timestamp NOT NULL,
  PRIMARY KEY (category_id)
)


CREATE TABLE language (
  language_id NUMERIC(3) NOT NULL,
  name varchar(20) NOT NULL,
  last_update timestamp NOT NULL,
  PRIMARY KEY (language_id)
)


CREATE TABLE film (
  film_id NUMERIC(5) NOT NULL,
  title varchar(128) NOT NULL,
  description varchar(1000),
  release_year NUMERIC(4) DEFAULT NULL,
  language_id NUMERIC(3) NOT NULL,
  original_language_id NUMERIC(3) DEFAULT NULL,
  rental_duration NUMERIC(3) NOT NULL,
  rental_rate decimal(4,2) NOT NULL,
  length NUMERIC(5) DEFAULT NULL,
  replacement_cost NUMERIC(5,2) NOT NULL,
  rating varchar(50),
  special_features varchar(254) DEFAULT NULL,
  last_update timestamp NOT NULL,
  PRIMARY KEY (film_id),
  CONSTRAINT fk_film_language FOREIGN KEY (language_id) REFERENCES language (language_id),
  CONSTRAINT fk_film_language_original FOREIGN KEY (original_language_id) REFERENCES language (language_id)
)


CREATE TABLE film_actor (
  actor_id NUMERIC(5) NOT NULL,
  film_id NUMERIC(5) NOT NULL,
  last_update timestamp NOT NULL,
  PRIMARY KEY (actor_id,film_id),
  CONSTRAINT fk_film_actor_actor FOREIGN KEY (actor_id) REFERENCES actor (actor_id),
  CONSTRAINT fk_film_actor_film FOREIGN KEY (film_id) REFERENCES film (film_id)
)


CREATE TABLE film_category (
  film_id NUMERIC(5) NOT NULL,
  category_id NUMERIC(3) NOT NULL,
  last_update timestamp NOT NULL,
  PRIMARY KEY (film_id,category_id),
  CONSTRAINT fk_film_category_category FOREIGN KEY (category_id) REFERENCES category(category_id),
  CONSTRAINT fk_film_category_film FOREIGN KEY (film_id) REFERENCES film(film_id)
)


CREATE TABLE film_text (
  film_id NUMERIC(6) NOT NULL,
  title varchar(255) NOT NULL,
  description varchar(1000),
  PRIMARY KEY (film_id)
)







